/* fonts */
export const FontFamily = {
  latoRegular: "Lato-Regular",
  openSansBold: "OpenSans-Bold",
  openSansSemiBold: "OpenSans-SemiBold",
  baloo2SemiBold: "Baloo2-SemiBold",
  robotoLight: "Roboto-Light",
  robotoBold: "Roboto-Bold",
  dangrekRegular: "Dangrek-Regular",
  robotoRegular: "Roboto-Regular",
  timesNewRoman: "Times New Roman",
};
/* font sizes */
export const FontSize = {
  size_5xl: 24,
  size_base: 16,
  size_sm: 14,
};
/* Colors */
export const Color = {
  white: "#fff",
  colorSteelblue: "#3f72af",
  colorBlack: "#000",
  colorGray_100: "rgba(0, 0, 0, 0.4)",
  colorGray_200: "rgba(0, 0, 0, 0.21)",
  colorWhitesmoke: "#f2f2f2",
  colorRed: "#fd0f00",
};
/* border radiuses */
export const Border = {
  br_xl: 20,
  br_13xl: 32,
  br_base: 16,
};
